    [],nt"num_tags": 4,nt"name": "northwest-montana-wetland-management-district-annual-narrative-report-calendar-year-1984",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Northwest
    Montana Wetland Management District outlines District accomplishments during the
    1984 calendar year. The report begins with a summary of the year's highlights and
    weather conditions. The report includes a planning section which discusses research
    and investigations. Refuge administration is outlined; information about personnel,
    volunteer programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, grasslands, grazing, haying, and
    pest control. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, migratory birds, raptors, game mammals, and fisheries resources.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, recreational uses, and law enforcement. The equipment and
    facilities section of the report provides information about new construction and
    rehabilitation. Cooperative programs and items of interest are provided at the end.
    Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
